import { Container, Header } from 'semantic-ui-react'

export default function RacialTraits(props) {


  useEffect(() => {
    fetch(`https://www.dnd5eapi.co/api/classes/${props.race}`)
      .then(res => res.json())
      .then(data => {}
    )
  })

  return (
    <>
    <Header>
      Racial Traits
    </Header>
    <Container>

    </Container>
    </>
  )
}
